import Container from "@material-ui/core/Container"
import TextField from "@material-ui/core/TextField"

export const NameAndPhone = ({data,setForm,navigation}) => {

    return (
      <Container>
      <h3>Name and phone number</h3>
      <TextField
      label="First name"
      name="firstName"
      value={data.firstName}
      />
       <TextField
      label="Last name"
      name="lastName"
      value={data.lastName}
      />
      </Container>
    )
}
